import React from 'react';
import tiktokIcon from '../assets/tiktok.png';
import instagramIcon from '../assets/instagram.png';

const SocialButtons = () => {
  return (
    <div className="flex space-x-4 mt-4">
      <a href="https://tiktok.com" target="_blank" rel="noopener noreferrer" className="social-button">
        <img src={tiktokIcon} alt="TikTok" className="h-8 w-8" />
      </a>
      <a href="https://instagram.com" target="_blank" rel="noopener noreferrer" className="social-button">
        <img src={instagramIcon} alt="Instagram" className="h-8 w-8" />
      </a>
    </div>
  );
};

export default SocialButtons;
